  false,\n\t\"url\": null,\n\t\"notes\": \"This map shows the average annual incidence
  of neuroinvasive West Nile virus disease in each state, which is calculated as the
  average number of new cases per 100,000 people per year from 2002 to 2014. The map
  is based on cases that local and state health departments report to CDCu2019s national
  disease tracking system. Neuroinvasive cases are those that affect the brain or
  cause neurologic dysfunction. For more information: www.epa.gov/climatechange/science/indicators\",\n\t\"license_title\":
